import React from "react";
import styled from 'styled-components'


const StyledLoginForm=styled.form`
display:flex;
margin:0 auto;
`;

const StyledLoginFormContainer=styled.form`
display:flex;
margin:0 auto;
`;

class LoginForm extends React.Component {
  render() {
    return (
        <StyledLoginFormContainer>
      <StyledLoginForm className="login-form">
        <h2 className="login-form__title">{this.props.title}</h2>

        <div className="login-form__input-container">{this.props.children}</div>

      </StyledLoginForm>
      </StyledLoginFormContainer>
    );
  }
}
export default LoginForm;
